    public static final SpannableString dealString(String pre, int mode){
        String a = ZHConverter.convert(pre, ZHConverter.TRADITIONAL);
        String b = "";
        List<int[]> red = new ArrayList<>();

        for (int i = 0; i < a.length(); i++) {
            String t = a.substring(i, i + 1);
            if(!common.isChinese(t.toCharArray()[0])) //非中文
                continue;

            String rsy = getRSY(t);
            if(!rsy.equals("")){
                String o ="["+t+" {a}]";
                if(mode == 0){
                    o = o.replace("{a}",rsy);
                }else{
                    String yb = RSYtoYinBiao(rsy.split(":")[0]);
                    if(mode == 1)
                        o = o.replace("{a}",yb);
                    else
                        o = o.replace("{a}",yb.substring(yb.length()-1));
                }

                red.add(new int[]{b.length(),b.length()+t.length()+1});
                red.add(new int[]{b.length()+o.length()-1,b.length()+o.length()});
                b+=o;
            }else{
                b+=t;
            }
        }

        SpannableString c = new SpannableString(b);
        for(int[] red0 : red){
            c.setSpan(new ForegroundColorSpan(Color.RED), red0[0], red0[1], Spannable.SPAN_INCLUSIVE_EXCLUSIVE);
        }
        return c;
    }

    public static final String getRSY(String zi){
        for(String data0 : data1){
            String[] data00 = data0.split(":");
            if (data00[2].equals(zi)) //屋:屋:屋
                return data00[0] + ":" + data00[1];
        }
        return "";
    }

